import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Blog Website</h1>
        <ul>
          {posts.map(post => (
            <li key={post.id}>{post.title}</li>))}
        </ul>
      </header>
    </div>
  );
}

export default App;
